import React, { Component } from 'react';
import './App.css';
import { Layout, Header, Navigation, Drawer, Content} from 'react-mdl';
import Main from './components/main';
import {Link} from 'react-router-dom';


class App extends Component {
  render() {
    return (
      <div style={{height: '300px', position: 'relative'}}>
    <Layout fixedHeader>
        <Header title={<span><strong style={{ color: 'black' }}>Harris Schrick</strong></span>}>
            <Navigation>
                <Link className="header-links-home" to="/">Homee</Link>
                <Link class="header-links" to="/resume">resume</Link>
                <Link class="header-links" to="/mywork">my work</Link>
                <Link class="header-links" to="/contactme">contact me</Link>
            </Navigation>
        </Header>
        <Content />
    </Layout>
</div>
    );
  }
}

export default App;
